import styled from "styled-components"

export const Title = styled.h1`
    position: relative;
    top: auto;
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    bottom: auto;
`;

export const Cabecalho = styled.div`
    background: red;
    height: 64px;

`;
export const Container = styled.div`
    background: blue;
`;
export const TitleLeft = styled.h2`
    position: relative;
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: left;
`;
